# ==========================================
# terraform.tf
# ==========================================
terraform {
  required_version = ">= 1.5"

  required_providers {
    aws = {
      source  = "hashicorp/aws"
      version = "~> 5.0"
    }
  }

  backend "s3" {
    bucket         = "my-terraform-state-bucket"
    key            = "s3-storage/terraform.tfstate"
    region         = "us-east-1"
    encrypt        = true
    dynamodb_table = "terraform-state-lock"
  }
}

# ==========================================
# providers.tf
# ==========================================
provider "aws" {
  region = var.aws_region
}

# ==========================================
# variables.tf
# ==========================================
variable "aws_region" {
  description = "The AWS region where resources will be created"
  type        = string
  default     = "us-east-1"
}

variable "bucket_name" {
  description = "The name of the S3 bucket for application storage"
  type        = string
}

variable "environment" {
  description = "The deployment environment (e.g., dev, staging, prod)"
  type        = string
}

variable "project_name" {
  description = "The name of the project associated with this infrastructure"
  type        = string
}

# ==========================================
# data.tf
# ==========================================
data "aws_caller_identity" "current" {}

data "aws_region" "current" {}

# ==========================================
# locals.tf
# ==========================================
locals {
  common_tags = {
    Environment = var.environment
    Project     = var.project_name
    ManagedBy   = "terraform"
  }
}

# ==========================================
# main.tf
# ==========================================
resource "aws_s3_bucket" "app_storage_bucket" {
  bucket = var.bucket_name
  tags   = local.common_tags

  lifecycle {
    prevent_destroy = true
  }
}

resource "aws_s3_bucket_server_side_encryption_configuration" "app_storage_encryption" {
  bucket = aws_s3_bucket.app_storage_bucket.id

  rule {
    apply_server_side_encryption_by_default {
      sse_algorithm = "AES256"
    }
  }
}

resource "aws_s3_bucket_versioning" "app_storage_versioning" {
  bucket = aws_s3_bucket.app_storage_bucket.id

  versioning_configuration {
    status = "Enabled"
  }
}

resource "aws_s3_bucket_public_access_block" "app_storage_public_access_block" {
  bucket                  = aws_s3_bucket.app_storage_bucket.id
  block_public_acls       = true
  block_public_policy     = true
  ignore_public_acls      = true
  restrict_public_buckets = true
}

resource "aws_s3_bucket_lifecycle_configuration" "app_storage_lifecycle" {
  bucket = aws_s3_bucket.app_storage_bucket.id

  rule {
    id     = "archive_to_glacier_and_expire"
    status = "Enabled"

    filter {}

    transition {
      days          = 90
      storage_class = "GLACIER"
    }

    expiration {
      days = 365
    }
  }
}

# ==========================================
# outputs.tf
# ==========================================
output "bucket_id" {
  description = "The name (ID) of the created S3 bucket"
  value       = aws_s3_bucket.app_storage_bucket.id
}

output "bucket_arn" {
  description = "The Amazon Resource Name (ARN) of the created S3 bucket"
  value       = aws_s3_bucket.app_storage_bucket.arn
}

output "bucket_region" {
  description = "The AWS region where the bucket resides"
  value       = aws_s3_bucket.app_storage_bucket.region
}
